import "../App.css";

const Home = () => {
  return (
    <div className="home_spacer">
      <div className="container">
        <div className="post_header">
            <div className="post_user_avatar"></div>
            <div className="post_user_name"></div>
        </div>
        <div></div>
      </div>
    </div>
  );
};

export default Home;
